import React, { Component } from "react";
import { connect } from "react-redux";
import logo from "../../assets/images/logo.png";

import {
  NavbarStyle,
  LogoContainer
} from "../../assets/components/layout/Navbar.style";

class Navbar extends Component {
  constructor(props) {
    super(props);
    this.state = {
      active: true
    };
  }

  showMenu() {
    this.setState({
      active: !this.state.active
    });
  }

  render() {
    return (
      <NavbarStyle className={this.state.active ? "active" : "inactive"}>
        <LogoContainer>
          <span className="brand-name">Stellar dashboard</span>
          <i class="material-icons" onClick={() => this.showMenu.bind(this)}>
            menu
          </i>
        </LogoContainer>
      </NavbarStyle>
    );
  }
}

const mapStateToProps = state => {
  return {};
};

export default connect(
  mapStateToProps,
  null
)(Navbar);
